float t = 0;

void update() {
  if (buttonX.bPressed) t = 0.f;
  if (t >= 0.f) t += deltaTime * 0.05f;
  if (inRange(t, 1.f, 1.03f)) {
    for (int i = 0; i < 10; i++) {
      bool x = random(2);
      particles.add(Particle(vec2f(x * oled::width, oled::height), vec2f(random(80, 120) * (x ? -1 : 1), -random(80, 120)), random(0xFFFF)));
    }
  }
  for (int i = 0; i < particles.size(); i++) {
    particles[i].vel.y += 80.f * deltaTime;
    particles[i].pos += particles[i].vel * deltaTime;
    if (!inRange<vec2f>(particles[i].pos, -5, oled::size() + 5)) particles.remove(i--);
  }
}

void draw() {
  oled::fillScreen(0xEF5B);
  Bezier::draw(path, sizeof(path) / sizeof(path[0]), t);
  oled::drawImage(Bezier::ptr, vec2i(30, 30), pencilRed, MAGENTA);
  for (int i = 0; i < particles.size(); i++) oled::fillRect(particles[i].pos - 1, 3, particles[i].color);
}

void start() {
  t = -1;
  Bezier::ptr = vec2f(-30, -10);
  game = Game(update, draw);
}
